import React, {useState} from 'react';
import LikedMovieContext from './likedMovie-context';

const LikedMovieProvider = props => {
  const [likedMovie, setLikedMovie] = useState([]);

  const cartContext = [
    {
      title: 'Hello',
      language: 'EN',
      releaseDate: 'dd',
      imgSource:
        'http://localhost:3000/static/media/s-1.cd52a6c70d4568da3edb.jpg',
    },
  ];

  return (
    <LikedMovieContext.Provider value={cartContext}>
      {props.children}
    </LikedMovieContext.Provider>
  );
};

export default LikedMovieProvider;
